import React from "react";
import { SectionList } from "../constant";
import SectionCard from "./SectionCard";

const Section = () => {
  return (
    <div className="w-full bg-gray-200 mb-10">
      <div className="grid md:grid-cols-2 lg:grid-cols-4 lg:px-16">
        {SectionList.map((item, i) => (
          <SectionCard key={i} data={item} />
        ))}
      </div>
      <div class="flex items-center justify-center ">
        <div class="relative">
          <span class="absolute inset-0 flex items-center justify-center text-gray-300 text-9xl font-bold">
            SERVICES
          </span>
          <span class="relative text-black text-3xl font-medium">
            product service
          </span>
        </div>
      </div>
    </div>
  );
};

export default Section;
